--
-- Name: salary(character varying, numeric, numeric, numeric); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.salary(e_type character varying, total_pet_days numeric, pet_days numeric, cost numeric) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
daysBefore60 NUMERIC := 0;
daysAfter60 NUMERIC := 0;
BEGIN
IF (e_type= 'parttime') THEN
RETURN pet_days * cost * 0.75;
ELSE
IF (total_pet_days >= 60) THEN
RETURN pet_days * cost * 0.8;
ELSIF (pet_days + total_pet_days > 60) THEN
daysBefore60 := 60 - pet_days;
daysAfter60 := pet_days - daysBefore60;
RETURN pet_days * cost * 0.8;
ELSE
RETURN  pet_days * cost;
END IF;
END IF;
END
$$;


