-- Name: update_caretaker_rating(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.update_caretaker_rating() RETURNS trigger
    LANGUAGE plpgsql
    AS $$ 
DECLARE 
rating NUMERIC := 0;
reviews_num INTEGER := 0;
BEGIN
SELECT COUNT(owner_rating) INTO reviews_num
FROM Transactions_Details
WHERE caretaker_email = NEW.caretaker_email;
IF (reviews_num > 0) THEN
SELECT AVG(owner_rating) INTO rating
FROM Transactions_Details
WHERE caretaker_email = NEW.caretaker_email;
END IF;

UPDATE Caretakers 
SET avg_rating = rating,
no_of_reviews = reviews_num
    WHERE (caretaker_email = NEW.caretaker_email);

RETURN NULL;
 END; 
$$;


