-- Name: user_exists_in_month(date, date, date); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.user_exists_in_month(startdate date, enddate date, input_month date) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE
firstDayOfMonth DATE := start_of_month(input_month);
lastDayOfMonth DATE := end_of_month(input_month);
BEGIN
RETURN (startDate <= lastDayOfMonth AND endDate >= firstDayOfMonth);
END
$$;


